import React from "react";
import ContactForm from "../Contact/ContactForm";

const ProblemSigningIn = () => {
	return (
		<>
			<p>
				If you're having problems signing in, you can contact us directly to
				resend your booking reference number:
			</p>
			<ContactForm />
		</>
	);
};

export default ProblemSigningIn;
